import React from 'react';
import { Box, Button } from '@material-ui/core';

export default class Apps extends React.Component {

  render() {
    return (
        <Box
        color="red"
        bgcolor="#90a4ae"
        style={{height:"60%"}}
        >
          <Button>
            HEY!!
          </Button>
        </Box>
    );
  }
}
